Now in ex2.rs we need to have a main function that's no_mangle, extern "C", and that doesn't ever return. To begin, we'll make the actual body of main just do what we were doing before. First write 0 to DISPCNT, and then do a loop forever. // ex2.rs
#![no_std]
#![no_main] use gba_from_scratch::DISPCNT; #[no_mangle]
pub extern "C" fn main() -> ! { DISPCNT.write(0); loop {}
} #[panic_handler]
fn panic_handler(_: &core::panic::PanicInfo) -> ! { loop {}
} And if we run this in mGBA with cargo run --example ex2 we see... actually we see a mostly black screen but with a white line on it. ex2_white_line That's... not what we expected? That's not either of the types of screen that we got before. Here's where things get kinda weird. If we run our program in --release mode we don't see the line. Let's look at the output of the compiler again with objdump. In fact, now that we've got more than one example let's have a script to store that "use objdump" stuff. I'm gonna make a dump.bat, but you can make dump.sh if you're on Mac or Linux. It's just a few plain commands, no special scripting. cargo build --examples arm-none-eabi-objdump target/thumbv4t-none-eabi/debug/examples/ex1 --section-headers --disassemble --demangle --architecture=armv4t --no-show-raw-insn -Mreg-names-std >target/ex1.txt arm-none-eabi-objdump target/thumbv4t-none-eabi/debug/examples/ex2 --section-headers --disassemble --demangle --architecture=armv4t --no-show-raw-insn -Mreg-names-std >target/ex2.txt Okay, and the target/ex1.txt file has about what we expect in it. A bunch of sections like we saw before and then. Disassembly of section .text: 08000000 <_start>: 8000000:	b	80000e4 <_start+0xe4> ... 80000e4:	mov	r0, #67108864	; 0x4000000 80000e8:	mov	r1, #0 80000ec:	strh	r1, [r0] 80000f0:	b	80000f0 <_start+0xf0> 80000f4:	udf	#65006	; 0xfdee Yep, just what we expected. Let's see what's in target/ex2.txt, same basic thing, right? Ah, wait, well there's 29 sections instead of 12. That's probably fine, more debug info or something, probably? Won't affect our code, I'm sure. Disassembly of section .text: 08000000 <_start>: 8000000:	b	80000e4 <_start+0xe4> ... 80000e4:	ldr	r12, [pc, #4]	; 80000f0 <_start+0xf0> 80000e8:	bx	r12 80000ec:	udf	#65006	; 0xfdee 80000f0:	.word	0x08000115 Sure, what we expected... 080000f4 <voladdress::voladdress_::VolAddress<T,R,voladdress::Safe>::write>: 80000f4:	push	{r7, lr} 80000f6:	sub	sp, #16 80000f8:	str	r1, [sp, #4] 80000fa:	