's more. It goes on and on, but I think you get the joke at this point. Yeah, rustc outputs utter garbage code without optimizations enabled. Just, atrocious. The only reason it's usable at all on your desktop is because modern computers are so fast. Our best bet is to just turn on full optimizations for the debug profile. This can be done in Cargo.toml. In a new profile.dev section we set the opt-level to 3. [profile.dev]
opt-level = 3 And rebuild / redump the program: Disassembly of section .text: 08000000 <_start>: 8000000:	b	80000e4 <_start+0xe4> ... 80000e4:	ldr	r12, [pc, #4]	; 80000f0 <_start+0xf0> 80000e8:	bx	r12 80000ec:	udf	#65006	; 0xfdee 80000f0:	.word	0x080000f5 080000f4 <main>: 80000f4:	movs	r0, #1 80000f6:	lsls	r0, r0, #26 80000f8:	movs	r1, #0 80000fa:	strh	r1, [r0, #0] 80000fc:	b.n	80000fc <main+0x8> That's it, that's our whole program once optimizations have been applied. Now we don't get the white line. Why did we get it before? I don't know exactly. Our ex2 program "stops" on an infinite loop that's just as fast as the ex1 version, even if it takes longer to get there. I'd have thought that it wouldn't make a difference, but somehow it does. Emulators are weird like that sometimes. Oh, and speaking of weird stuff, while we're adjusting build configuration things, I found out about that undefined instruction thing. Our good friend Scott wrote in (so to speak) and suggested trying -Ztrap-unreachable=no in RUSTFLAGS. So we just add it in the .cargo/config.toml: [target.thumbv4t-none-eabi]
rustflags = ["-Ztrap-unreachable=no", "-Clink-arg=-Tlinker_scripts/normal_boot.ld"]
runner = "mgba-qt" and rebuild / redump again... Disassembly of section .text: 08000000 <_start>: 8000000:	b	80000e4 <_start+0xe4> ... 80000e4:	ldr	r12, [pc]	; 80000ec <_start+0xec> 80000e8:	bx	r12 80000ec:	.word	0x080000f1 080000f0 <main>: 80000f0:	movs	r0, #1 80000f2:	lsls	r0, r0, #26 80000f4:	movs	r1, #0 80000f6:	strh	r1, [r0, #0] 80000f8:	b.n	80000f8 <main+0x8> The undefined instruction is gone! Magical! I guess the explanation is that LLVM is trying to add in a "guard" against code accidentally flowing past the end of the function. When the CPU is made to execute and undefined instruction it causes a special kind of "interrupt" to happen. We'll mostly talk about interrupts later, but for now let's just say that what LLVM is expecting is that the Operating System will handle the interrupt by killing the program (the undefined instruction "traps" your program). We don't really have an OS on the GBA, we are the OS you might say. Regardless of what you call it, that undefined instruction won't "trap" like LLVM thinks it will. The undefined interrupt handler in the BIOS just returns and the device just keeps executing. So that undefined instruction is purely a waste of space to us. We might as well leave -Ztrap-unreachable=no set in our configuration. The -Z part means that it's a Nightly flag, but we're on Nightly for other stuff already so it's fine. If we have to be on Nightly for build-std, we might as well take advantage of the other extra flags we can.

