The "backdrop" color is the color that's shown in a pixel if no background layer or object is visible in that pixel. Right now when we turn off forced blank we see a black screen because the backdrop color is black. If we were to change the backdrop color we'd see the whole screen filled with some other color. First let's declare an MMIO for the backdrop color. // in lib.rs
pub const BACKDROP: VolAddress<u16, Safe, Safe> = unsafe { VolAddress::new(0x0500_0000) }; Now let's update ex2.rs so that we set the backdrop color before we turn off forced blank. // in ex2.rs
use gba_from_scratch::{BACKDROP, DISPCNT}; #[no_mangle]
pub extern "C" fn main() -> ! { BACKDROP.write(0b11111); DISPCNT.write(0); loop {}
} Let's look at that assembly: 080000f0 <main>: 80000f0:	movs	r0, #5 80000f2:	lsls	r0, r0, #24 80000f4:	movs	r1, #31 80000f6:	strh	r1, [r0, #0] 80000f8:	movs	r0, #1 80000fa:	lsls	r0, r0, #26 80000fc:	movs	r1, #0 80000fe:	strh	r1, [r0, #0] 8000100:	b.n	8000100 <main+0x10> So first it gets the BACKDROP address in a register (5<<24), then the color value (31), then writes that, and the rest of the program is like we've seen before. Makes sense. We could also change the backdrop color after turning off forced blank if we wanted to. However, by default it's best practice to only adjust the display when forced blank is on or when you know it's the vertical blank period. Otherwise you can get accidental display artifacts on the screen. If we run the program now we'll see a red screen. The magic looking 0b11111 value is because the GBA has 5-bit per channel color. A GBA color value is a u16 with the channels going from low to high: 0bX_BBBBB_GGGGG_RRRRR So 0b11111 is "full red, no green or blue". Using a raw u16 isn't that great. We'd probably like to have a little bit more meaning to the type so that it's clearer what's going on. We can put names on our functions and magic values, things like that. If we replace the u16 in BACKDROP with a repr(transparent) wrapper type over an actual u16 then things will be a lot better. This is called using a "newtype", and we'll be doing it a lot. // in lib.rs
pub const BACKDROP: VolAddress<Color, Safe, Safe> = unsafe { VolAddress::new(0x0500_0000) }; #[derive(Clone, Copy, PartialEq, Eq)]
#[repr(transparent)]
pub struct Color(pub u16);
impl Color { pub const RED: Self = Self::rgb(31, 0, 0); #[inline] #[must_use] pub const fn rgb(r: u16, g: u16, b: u16) -> Self { Self(r | (g << 5) | (b << 10)) }
} Then we change ex2.rs to use our new Color type. use gba_from_scratch::{Color, BACKDROP, DISPCNT}; #[no_mangle]
pub extern "C" fn main() -> ! { BACKDROP.write(Color::RED); DISPCNT.write(0); loop {}
} Practically self-documenting code at this point! If we run the program again we can see a red screen too. Let's double check our assembly to make sure we didn't kill performance somehow. 080000f0 <main>: 80000f0:	movs	r0, #5 80000f2:	lsls	r0, r0, #24 80000f4:	movs	r1, #31 80000f6:	strh	r1, [r0, #0] 80000f8:	movs	r0, #1 80000fa:	lsls	r0, r0, #26 80000fc:	movs	r1, #0 80000fe:	strh	r1, [r0, #0] 8000100:	b.n	8000100 <main+0x10> Hey it's the exact same as before. We've got a zero-runtime-cost abstraction, the promise of Rust is real!

