Fun as it is to have a single static color, that's still not very exciting. We can read the current state of the keys from the KEYINPUT control. This includes both the "buttons" as well as the direction-pad value. // in lib.rs
pub const KEYINPUT: VolAddress<u16, Safe, ()> = unsafe { VolAddress::new(0x400_0130) }; Note that instead of Safe as the write type we've put () instead. The key data is naturally write only. The CPU can't just tell the GBA to make a button be pressed or not. With this new MMIO we can show a color based on the keys: // in ex2.rs
#[no_mangle]
pub extern "C" fn main() -> ! { DISPCNT.write(0); loop { let k = KEYINPUT.read(); BACKDROP.write(Color(k)); }
} Now if we run the program and press different keys we'll see the color change. Each bits of KEYINPUT that's connected to a key will be 0 when the key is pressed and 1 when the key is released. Bits not connected to a key will always just be 0. Which key controls which bit is as follows: Bit Key 0 A 1 B 2 Select 3 Start 4 Right 5 Left 6 Up 7 Down 8 R 9 L Like with the color data, we probably want to make a newtype for all this. // in lib.rs
pub const KEYINPUT: VolAddress<KeyInput, Safe, ()> = unsafe { VolAddress::new(0x400_0130) }; #[derive(Clone, Copy, PartialEq, Eq)]
#[repr(transparent)]
pub struct KeyInput(pub u16);
#[rustfmt::skip]
impl KeyInput { #[inline] pub const fn a(self) -> bool { (self.0 & (1<<0)) == 0 } #[inline] pub const fn b(self) -> bool { (self.0 & (1<<1)) == 0 } #[inline] pub const fn select(self) -> bool { (self.0 & (1<<2)) == 0 } #[inline] pub const fn start(self) -> bool { (self.0 & (1<<3)) == 0 } #[inline] pub const fn right(self) -> bool { (self.0 & (1<<4)) == 0 } #[inline] pub const fn left(self) -> bool { (self.0 & (1<<5)) == 0 } #[inline] pub const fn up(self) -> bool { (self.0 & (1<<6)) == 0 } #[inline] pub const fn down(self) -> bool { (self.0 & (1<<7)) == 0 } #[inline] pub const fn r(self) -> bool { (self.0 & (1<<8)) == 0 } #[inline] pub const fn l(self) -> bool { (self.0 & (1<<9)) == 0 }
} (This is kinda begging for a macro_rules!, but it's basically fine to put that off until later.) Also let's add a definition for GREEN on our color type. impl Color { pub const RED: Self = Self::rgb(31, 0, 0); pub const GREEN: Self = Self::rgb(0, 31, 0); // ...
} Now we can read the keys, and set the color to red or green based on if a key is pressed or not: #[no_mangle]
pub extern "C" fn main() -> ! { DISPCNT.write(0); loop { let k = KEYINPUT.read(); BACKDROP.write(if k.a() { Color::RED } else { Color::GREEN }) }
} And I think that's enough for one article. This is the exact commit of the project files when I finished writing this article.

