error[E0463]: can't find crate for `std` | = note: the `thumbv4t-none-eabi` target may not support the standard library = note: `std` is required by `gba_from_scratch` because it does not declare `#![no_std]` = help: consider building the standard library from source with `cargo build -Zbuild-std` For more information about this error, try `rustc --explain E0463`.
error: could not compile `gba_from_scratch` (lib) due to previous error That's different from before at least. Well, we told to to only build core and not std, and then it said we couldn't use std. Makes sense. Lets change the example. // ex1.rs
#![no_std] fn main() { println!("hello");
} And we need to fix our lib.rs to also be no_std. It doesn't do anything else for now, it's just blank beyond being no_std. // lib.rs
#![no_std] Now rust-analyzer is telling me we can't use println in our example. Also, we're missing a #[panic_handler]. Here's the error. > cargo build --example ex1 --target thumbv4t-none-eabi -Z build-std=core Compiling gba_from_scratch v0.1.0 (/Users/dg/gba-from-scratch)
error: cannot find macro `println` in this scope --> examples/ex1.rs:4:3 |
4 | println!("hello"); | ^^^^^^^ error: `#[panic_handler]` function required, but not found error: could not compile `gba_from_scratch` (example "ex1") due to 2 previous errors Well, we can comment out the println!. For the panic handler, we go to the Attributes part of the rust reference. That links us to panic_handler , which sets what function gets called in event of panic. // ex1.rs
#![no_std] fn main() { //
} #[panic_handler]
fn panic_handler(_: &core::panic::PanicInfo) -> ! { loop {}
} Now we get a new, different error when we try to build: > cargo build --example ex1 --target thumbv4t-none-eabi -Z build-std=core Compiling gba_from_scratch v0.1.0 (/Users/dg/gba-from-scratch)
error: requires `start` lang_item error: could not compile `gba_from_scratch` (example "ex1") due to previous error Alright so what's this start lang item deal? Well it has to do with the operating system being able to run your executable. The details aren't important for us, because there's no operating system on the GBA. Instead of trying to work with the start thing, we'll declare our program as #![no_main]. This prevents the compiler from automatically generating the main entry fn, which is what's looking to call that start fn. Note that this generated main fn is separate from the main fn that we normally think of as being the start of the program. Because, as always, programmers are very good at naming things. // ex1.rs
#![no_std]
#![no_main] fn main() { //
} #[panic_handler]
fn panic_handler(_: &core::panic::PanicInfo) -> ! { loop {}
} Okay let's try another build. > cargo build --example ex1 --target thumbv4t-none-eabi -Z build-std=core Compiling gba_from_scratch v0.1.0 (/Users/dg/gba-from-scratch)
warning: function `main` is never used --> examples/ex1.rs:4:4 |
4 | fn main() { | ^^^^ | = note: `#[warn(dead_code)]` on by default warning: `gba_from_scratch` (example "ex1") generated 1 warning Finished dev [unoptimized + debuginfo] target(s) in 0.64s Okay. It builds.

