What's wrong is that we need to adjust the linker script . That link goes to the documentation for the binutils linker (called ld), and technically we're actually using the linker that ships with the compiler (called rust-lld). rust-lld is the Rust version of lld, which is LLVM's linker that's intended to be a "drop in" replacement for GNU's ld. Both linkers use a linker script system, and they both even use the same linker script format. I tried to find an in depth manual for lld specifically, but all I could find was the top level "man page" explanations. Referring to the the GNU ld manual will have to do. You don't have to read the whole manual, the short story goes like this: linkers take one or more "object" files and "link" them into a single "executable" file. The linker script is what guides the linker in exactly what to do. If you don't say what script to use then the linker will use a default linker script that it keeps wherever. When the target is a "normal" target like Windows or Mac then using a default linker script is just fine. When the target is something a little more esoteric, like most embedded devices, including the GBA, then the default won't be good enough. We'll have to write our own script and make the linker use that. One complexity here is that the linker script to use is an argument passed to the linker. And the way you pass args to the linker is that you tell rustc to do it. Except with cargo build there's no way to tell rustc an extra argument. We could use cargo rustc, but it's a pain to have to remember an alternate command. As much as possible we'd like cargo build to work. We could use a build.rs file to pass an arg to the linker, but making a build script just to pass one argument seems like maybe overkill. Probably we should just set it as part of our the RUSTFLAGS environment variable. The catch with RUSTFLAGS is that any time you change it you have to build the entire crate graph again. We want to "write it down" (so to speak) and have it automatically be the same every time. This can be done with a cargo configuration file. First let's make a blank normal_boot.ld file in a linker_scripts/ folder. Then in the .cargo folder we fill in config.toml # .cargo/config.toml [target.thumbv4t-none-eabi]
rustflags = ["-Clink-arg=-Tlinker_scripts/normal_boot.ld"] while we're at it, we can even set a default target (which is used when we don't specify --target, and we can configure for build-std to be automatically be used, all in the same file. # .cargo/config.toml [unstable]
build-std = ["core"] [build]
target = "thumbv4t-none-eabi" [target.thumbv4t-none-eabi]
rustflags = ["-Clink-arg=-Tlinker_scripts/normal_boot.ld"] Great, let's try it out > cargo build --example ex1
warning: function `main` is never used --> examples\ex1.rs:4:4 |
4 | fn main() { | ^^^^ | = note: `#[warn(dead_code)]` on by default warning: `gba_from_scratch` (example "ex1") generated 1 warning Finished dev [unoptimized + debuginfo] target(s) in 0.10s Cool. It's a lot less to type, and we're ready to fill in our linker script. Our linker script is called normal_boot.ld because there's two ways for the GBA to boot up. One of them is the "normal" style with a program running off of the game pak. The other is "multiboot" where the GBA can download a program over the link cable. Since we might want to do multiboot some day, we might as well give our linker script a specific name to start with. Once things are set up we won't really have to think about it on a regular basis, so it's fine. There's three things we'll have to concern ourselves with: The entry point The memory locations The sections Picking an entry point is easy, it's just the name of a symbol. The traditional entry point name is just _start, so we'll go with that. ENTRY(_start) Having an entry point set doesn't really matter for running the program on actual GBA hardware. Still when the entry point ends up at one of the usual address values, it helps the heuristic system mgba uses to determine if it should run our program as a normal game or a multiboot game, so it's not entirely useless. Which brings us to the memory portion. The GBA has three main chunks of memory: Read-Only Memory (ROM), Internal Work RAM (IWRAM), and External Work RAM (EWRAM). We can cover more of the fine differences later, for now it's enough to write them down into our linker script. For each one we have to specify the base address and the size in bytes. MEMORY { ewram (w!x) : ORIGIN = 0x2000000, LENGTH = 256K iwram (w!x) : ORIGIN = 0x3000000, LENGTH = 32K rom (rx) : ORIGIN = 0x8000000, LENGTH = 32M
} Finally, we have to tell the linker which output section to assign all of the input sections it finds. This uses a glob-matching sort of system. We specify an output section that we want to have created, and then in the braces for it we list matchers that are checked against each input section the linker sees. When an input section fits one of the matchers, it goes with that output section. Program code is supposed to end up in the .text section, so we can start with just that. SECTIONS { .text : { *(.text .text.*); } >rom
} Here we've got one matcher listed, *(.text .text.*);. The * at the start means it applies to any input file. We could limit what files it applies to, if we wanted, but generally we shouldn't. Inside the parenthesis is a space separated list of globs. We've got two: .text and .text.*. The first is for the exact match .text, and the second is for anything that starts with .text.. The convention for section names is to start with a ., and they can't have spaces. Rust will default to having every function in its own section, all with the prefix .text.. Unused code can only be removed one entire input section at a time, so having every function in a distinct input section keeps our output as small as possible. The >rom part after tha braces allocates the entire output section into the rom memory that we declared before. All together, we've got this: /* normal_boot.ld */
/* THIS LINKER SCRIPT FILE IS RELEASED TO THE PUBLIC DOMAIN (SPDX: CC0-1.0) */ ENTRY(_start) MEMORY { ewram (w!x) : ORIGIN = 0x2000000, LENGTH = 256K iwram (w!x) : ORIGIN = 0x3000000, LENGTH = 32K rom (rx) : ORIGIN = 0x8000000, LENGTH = 32M
} SECTIONS { .text : { *(.text._start); *(.text .text.*); } >rom
} This isn't a complete and "final" linker script, but for now it's enough to let us proceed. If we rebuild the program right now we still won't get anything in the output .text section. Remember that dead code warning we keep getting on our main function? Nothing in our program ever calls main, and it's not public for outsiders to call, so it gets discarded during linking. Since no code can call main then no code can panic either, and the panic_handler function gets removed as well. We end up with nothing at all.
